"<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nJeanette M. Speer<br />\nMay 8, 1936 - July 1, 2018<br />\nJeanette M. Speer, age 82, of Conneaut, OH died at her residence, Saturday July 1, 2018.<br />\nShe was born May 8, 1936 in Conneaut, the daughter of Leroy \"Spike\" and Barbara (Gosley) Naylor. She graduated from Conneaut High School in 1954 and married the love of her life Charlie Speer on June 5, 1954. Jeanette went to work for her father's accounting firm, which would later become Sheppard CPA. After working for Ed Sheppard, Jeanette later became owner/operator of Speer Accounting. Jeanette has been involved in the accounting business for over 60 years.<br />\nJeanette was a member of Corpus Christi Parish, Red Hat Ladies, Garden Club, Lake Erie Boat Club, American Legion Ladies Auxiliary, Conneaut Moose Club, Conneaut Rotary Club, Conneaut Board of Tourism. She was very active with the Outdoor Learning Center, Human Resource Center's Food Pantry, volunteered with cooking and delivering holiday dinners throughout the Conneaut area and volunteered her time with Hospice for over 30 years. Jeanette was devoted to her community and was honored as a former citizen of the month.<br />\nJeanette enjoyed camping, kayaking, boating on Lake Erie. Her husband Charlie had a Classic Chris-Craft run-about boat. Both Charlie and Jeanette loved to travel to various classic boat shows and enjoyed showing and riding in their Chris-Craft. Jeanette loved to spending time with family and friends.<br />\nShe was preceded in death by her parents, husband Charlie Speer (2003), a daughter Mary McCoy (2015), two brothers Denny and Thomas Naylor and a \u00bd brother Robert \"Spike\" Naylor.<br />\nJeanette is survived by two sons Phillip (Judy) Speer of Kansas and Andy (Karen Fair) Speer of Mentor, two daughters Paula (Don) DeMarco of Fredericktown, Oh and Pamela Bolinger of Painesville, grandchildren, Angela, Starla, Crystal, Annie, Laura, Donnie III, Nancy, April, Ryan, Joshua, Adam, Melissa and April along with several Great grandchildren and several nieces and nephews.<br />\nPrivate burial services will take place at the convenience of the family in Glenwood Cemetery, Conneaut.<br />\nArrangements are being handled by the Raisian Family Funeral Home, 581 Harbor St., Conneaut.<br />\nCondolences at www.raisianfuneralhome.com<br />\nPublished on July 5, 2018<br />\nhttps://obituaries.starbeacon.com/obituary/jeanette-speer-1066605148\n</p>\n</div>\n</div>",
