"<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nEdgarC Speer<br />\nFuneral serivces for   Edgar C  Speer, 57 where   held  2pm Firday  and Thompson  Funeral  Home. <br />\nMr  Speer dieth Thrusday morning in St  Vincent Hostpital Erie Pa.  of  injuries sustained Nov  28 in and  accident at Public Dock.<br />\nMr Speer was born  in Cherry Hill PA on Nov  14 1909,  The son of Fred G and Clara (Moon) Speer. He  resided in the area  his entire life and  at  one time had  been  employed as a  machinist  for   the  Nickel Plate Railroad for  33 years.  More recently he had  been employed at the  P &amp;  C  Dock Co.<br />\nMr  Speer  was  active   in boating circles  and  served   a secratary of  the  Conneaut  Boat Club for  four years. <br />\nSurvivors nclude his  wive  Madeline,  two  dauthers  Mrs Clair (Clarice) Steward,  North  Kingsville and  Mrs John (Cath-......\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMary D. (Speer) McCoy<br />\n2015 - 2015<br />\n Recommend Mary's obituary to your friends<br />\nPlant A Tree For Mary McCoy<br />\nObituary<br />\nTribute Wall<br />\nShare / Subscribe to this tribute<br />\n  <br />\nObituary of Mary D. (Speer) McCoy<br />\nMary D. (nee Speer) McCoy<br />\nCOLUMBUS- Mary Denise (Speer) McCoy, 55, of Columbus formerly of Conneaut passed away unexpectedly, April 7, 2015.<br />\nShe was born September 20, 1959, in Conneaut the daughter of Charles and Jeanette (Naylor) Speer. Mary graduated from Conneaut High School Class of 1978. Mary worked for various cleaning services over the years, where she was recognized as employee of the month on a few occasions. She later started and ran her own cleaning service in Powell Ohio for many years.<br />\nMary enjoyed drawing, bowling, warm weather, and chocolate, but most of all she enjoyed spending time with her family. She enjoyed helping others in any way that she could, and was always helping clean, cook, and care for her grandchildren. They were by far one of the highlights of her life. <br />\nMary is survived by her daughters, Melissa (Boe) Rye of Columbus, and April (Josh) Pullins of Hilliard; her mother Jeanette Speer of Conneaut; sisters, Pam Bollinger of Painesville, Paula (Donald) DeMarco of Fredericktown, OH; brothers, Andrew (Cherie) Speer of Eastlake, and Phillip (Judy) Speer of Manhattan, KS; uncle, Dennis \u201cMichael\u201d Naylor of Maryland; two grandsons, Jesse and Dylan Pullins; as well as many nieces and nephews.<br />\nShe was preceded in death by her father, Charles Speer; paternal grandparents, Edgar and Madeline (Slocum) Speer; maternal grandparents, L.R. and Barbara (Gosley) Naylor; and uncle, Thomas Naylor.<br />\nThere are no services planned at this time, cremation took place in Columbus. THOMPSON-SMITH-NESBITT- FUNERAL HOME, 345 Main St., Conneaut is handling local arrangements. Online guestbook and condolences at www.thompsonsmithnesbitt.com<br />\nTo plant a tree in memory of Mary McCoy, please visit Tribute Store\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
