"<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMarie  Cake Obitiuary  Star Beacon\n</p>\n<p>\nMarie Kane<br />\nJuly 23 1939 -  March  28 2016\n</p>\n<p>\nLong  Time Ashtabula resident  Marie Kane passed away from cancer  complications  March 28 2016 in  La  Mesa  Claif\n</p>\n<p>\nShe is survived and  will be  sorely   missed  by  her  husband   of over  57  year J  Brian  of Ashtabula; sonce  Vince  of Spring, Texas and Dennis of  El  Cajon Calif.  She is  also survived by a brother  Rober (Barbara) Mcoy of  Conneaut; sister June Howell of the Detroit ares; brothers in law, Mike  (Kay) Kane of Madison and  Ken (Billie Moore) Kane  of Ashtabula. She is  also  very  much missed by  her  10 year old  Labrador Retriever, Pepper.\n</p>\n<p>\nMarie was  born  July  23  1939 in Ashtabula  Ohio,  to Woodrow  and Norma  (Timonere)   McCoy,  who preceded  her  in passing. She was  a  Harbor High School  Graduate  (57)  where  she was homecoming queen her senior year.  She also  attended Kent State  University - Ashtabula\n</p>\n<p>\nShe was a  long time employee of Carlises   department store and  People's Savings Bank   of Ashtabula\n</p>\n<p>\nShe is   especially loved  her  famil, enjoyed walks with her dog  shopping visiting   with family and freidls and  visiting her   sons in Texasand  California.\n</p>\n<p>\n......\n</p>\n<p>\nA Private Commital  Ceremony  and burial will be performed in St  Josephs cemetary  in Ashtabula.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Dunn County News<br />\n7/8/1959<br />\nP19\n</p>\n<p>\nOliver C Rye\n</p>\n<p>\nOliver Cornelius Rye the son of Paul  and Anna Olsen Rye was born Nov 3 1888 in Prarie Farm. <br />\nIn 1914 he was  united in marriage to Freida Smith.  THe operated  the farm south  of Glennwood until  1943 when they moved  to Menomine where he had sence been employed as (illegible)  salesman and also worked in  the  Menonomine Greenhouse.\n</p>\n</div>\n</div>",
