"<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nTHe Dunn County News 3-10-1943 <br />\nP7<br />\nColumn 2\n</p>\n<p>\n... <br />\nMrs Floyd McIntyre went to Glenwood City Thursday to stay at the home of her daughter Mrs. Martin Rye, who gave  birth to a son  March 4  at Glenwood City. Norma  McIntyre  spent the weekend  that the Martin  Rye home also....\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Dunn County News<br />\n7/1/1959<br />\nP1\n</p>\n<p>\nNumber 14\n</p>\n<p>\nOliver Rye Death Car<br />\n(Photo)<br />\nThe car on the right is the one which Oliver Rye 1509 Broadway, Menonmine was driving when he was killed instantly in a mishpa late sunday afternoon four miles east  of Clear Lake\n</p>\n<p>\nOliver Rye, City Killed in Mishap\n</p>\n<p>\nOliver Rye 71 of 1509 Broadway was kiled  instantly SUnday about 5:20pm in a car accident  four miles east of Clear Lake in Polk County<br />\nHe was returning to his home in Menomine after Visiting his daughter's Cottage in Balasm Lake<br />\nHe was  alone  at  the time of the accident and only one person was in the other car. Mrs DuWayne Rowen about 30, clear  lake, who is in  Amery Hospital suffering from cuts, lacerations and possibly concussion. Mrs Rowen is pregnant.<br />\nThe mishap occure at the junction  of two county trunks \"PP\" and \"A\". Traffic officers reported skid marks from the Rowen car  for  106  feet  and the car  was tossed 60  feet after impact. <br />\nRye  was declared dead at the  scene of the accident by a physician and  the body taken to DCamp Funeral Home, Glenwood City where  funeral services  were held  Wednesday (7/1/1919) at 2pm with  burial at  the Hersey  Evergreen  Cemetary. Rev Jerome Trelstad officiating. <br />\nMrs  Rye died last November.<br />\nSurvivors  include sons Paul Rye, 1508   2nd st Menomonie Martin Rye   Glenwood City and Mrs Jack (Florence) Rye  St Paul.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nTo Join in Honoring Manager<br />\nA &amp; P Store Sale Will Be Anniversary Event\n</p>\n<p>\nPersonnel of the Great Atlantic and Pacific Tea Co. store on south 5th street are shown above. The Store is launching a Store Manager's Anniversary Sale this week in honor of the first anniversary of Manager J. C. Keehan's association with the local supermarket\n</p>\n<p>\nKheehan came to Newark last May shortly after the new store opened. He has bee naffiliated with A&amp;P for the past 15 years and has operated stores in Parkersburg W. Va., Logan and Columbus Ohio.\n</p>\n<p>\nShown in the photo .........\n</p>\n<p>\nSecond row left  to right, Robert Clouston, meat department ........\n</p>\n</div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nBill is in the second row far left\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Newark Advocate May 26 1977 p. 6\n</p>\n<p>\nEngaments\n</p>\n<p>\nJuly 2 is the date chosen for the marriage of Reba Rector, daughter of Mr. and Mrs Raymond R. Rector, 1543 Ditmor Stroll, to Mark W. Clouston, Son of Mr and Mrs, Robert W. Clouston, 463 Deerfield Dr.\n</p>\n<p>\nThe Bride Elect is a Graduate of Newark Catholic High School and is a personeal lines assistant for state farm insurance co\n</p>\n<p>\nMr. Clouston is a Newark High graduate and is employed in the cable department of the Newark Telephone Co.\n</p>\n<p>\nThe wedding will be in St. Francis de Sales Church.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Newark Advocate, July 21 1970 P.9\n</p>\n<p>\nA&amp;P Meat Manager Honored For 25 Years\n</p>\n<p>\nRobert Clouston, meat manager of the A&amp;P, South Fifth Street, was awarded a plaque last week in recognition of 25 years of service to his company. Clouston started work with the A&amp;P in zanesville as a clerk in 1945. Eighteen years ago he came to Newark and has been meat manager of the store for 16 years.\n</p>\n<p>\nThe biggest chand in that time he says has been the switch from counter service to self service with factory preparation and packaging of meats\n</p>\n<p>\nClouston says people miss the personal contact the once hand with the butcher but dosenth thin the would welcome a switch away from self service. \"Factory preperation saves people money\", he pointed out. \"The cost of living is so high that most people can't afford to pay more than they are paying now\"\n</p>\n<p>\nThe meat manager explained factory preparation and modern machinery limit the number of people needed to the store meat department. He added that sanitary conditions in the plant are better than the could be in a store because of (illegible) equipment and frequent inspections\n</p>\n<p>\nClouston and his wife Norma live at 463 Dearfield Drive. The have Two Children Mardi, 17 and Mark 13.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Times Recorder (Zanesville) Thursday July 3 1947 p.14\n</p>\n<p>\nRobert W. Clouston On Training Trip\n</p>\n<p>\nRobert W. Clouston, fireman first class , USN, son of Bernice Clouston of 1448 1/2 Euclid avenue, zanesville, has completed a two-week Naval reserve training cruise to Hamilton Bermuda, aboard the attack cargo ship USS Marquette\n</p>\n<p>\nOne these training cruises, gunnery drills, battle drills, battle problems, and lectures are given to refresh the reservists previous tranining and acquatin them to the latest development in Naval equipment.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Times Recorder: Monday March 8 1948\n</p>\n<p>\nMay 2 Chosen For Wedding\n</p>\n<p>\nMr. and Mrs. E. E. McFarland of 820 Woodlawn avenue are annaouncing the engagement and approaching marriage of their daughter, Norma, to William Clouston of Mrs Berniece Clouston 915 (Bl..) avenue.\n</p>\n<p>\nThe double ring ceremony will be read at 2 o'clock Sunday, May 2, in the first Methodist church, by  Rev E.F. Acold. Open church will be observed.\n</p>\n<p>\nMiss McFarland is a graduate of Lash high school and is employed by Ray A. Miller and company. She is a member of First Methodist Church.\n</p>\n<p>\nMr Clouston also attended Las high school and served two years in the navy. He is employed by A&amp;P company.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n(News  Clipping  of  The  Sept 14 1944  Edition of the Zanesville  Times Recorder)\n</p>\n<p>\n(Divorce  Hearing  Notice)\n</p>\n<p>\nIn  Court  Today Judge Tannerhill is  scheduled to  hear 10 divorce  actoins They are:\n</p>\n<p>\nBernice Clouston against Hanibal H Clouston. Lesure &amp; Walters  for the Plaintiff\n</p>\n<p>\n......\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\nElmer McFarland\n</p>\n<p>\nElmer E. McFarland 71 of 820 Woodlawn ave was Dead on arrival at bethesda Hospital at 9:15 am Wednesday after suffering a heart attack at his home. \n</p>\n<p>\nMr. McFarland was born March 27 1893 in Muskingum County, a Son of Levi and Mary Figley McFarland and was a lifelong resident of the area\n</p>\n<p>\nHe Retired in 1958 as a  mold and die maker for the Zanesville Stoneware Pottery, He was a Member of the Eagles Lodge.\n</p>\n<p>\nSurviving are his Widow, Vada Son James E McFarland of 686 McIntire ave. four daughters Mrs Lillian McDonald of the Home, Mrs Mary Jane Pollard of Dayton, Mrs Mildred Uphold of 643 Mongahala ave and Mrs Norma Clouston of Newark, 11 Grandgrandchildren, three Sisters Mrs Florence Kranz of 915 Echo ave, Mrs Frances Grishy of Youngstown and Mrs Albert Adams of Youngstown.\n</p>\n</div>\n</div>",
